import React, { useState } from 'react';
import ReactDOM from 'react-dom'
import { Layout, Menu, Breadcrumb } from 'antd';
import HomePage from "../../pages/disconnected/HomePage";
import { BrowserRouter as Router, Link } from "react-router-dom";
import Docs from "../../pages/connected/Docs";
import './Navbar.css';

const Navbar = () => {
    const { Header, Content, Footer } = Layout;

    return(
        <Layout className="layout">
            <Header>
            <div className="logo" />
            <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
                <Menu.Item key="1">Vemo</Menu.Item>
                <Menu.Item key="2">Post</Menu.Item>
                <Menu.Item key="2">Login</Menu.Item>
            </Menu>
            </Header>
            <Content style={{ padding: '0 50px' }}>
            <div className="site-layout-content">Content</div>
            </Content>
            <Footer style={{ marginLeft: "100px" }}>Limbo Â©2022 Created by Limbo Team</Footer>
        </Layout>
    )
}

export default Navbar;
